import {SET_NAME, SET_ROOM, GO_TO_LOBBY} from './types'

export const setName = (name) => dispatch => {
    dispatch({
        type: SET_NAME,
        payload: name
    })
}

export const setRoom = (room_id) => dispatch => {
    dispatch({
        type: SET_ROOM,
        payload: room_id
    })
}

export const goToLobby = () => dispatch => {
    dispatch({
        type: GO_TO_LOBBY
    })
}
